public class InnerQuickConnectQuickConnectConfigFactory(Action<Humidifier.Connect.QuickConnectTypes.QuickConnectConfig> factoryAction = null) : SubResourceFactory<Humidifier.Connect.QuickConnectTypes.QuickConnectConfig>
{

    internal InnerQuickConnectQueueQuickConnectConfigFactory QueueConfigFactory { get; set; }

    internal InnerQuickConnectPhoneNumberQuickConnectConfigFactory PhoneConfigFactory { get; set; }

    internal InnerQuickConnectUserQuickConnectConfigFactory UserConfigFactory { get; set; }

    protected override Humidifier.Connect.QuickConnectTypes.QuickConnectConfig Create()
    {
        var quickConnectConfigResult = CreateQuickConnectConfig();
        factoryAction?.Invoke(quickConnectConfigResult);

        return quickConnectConfigResult;
    }

    private Humidifier.Connect.QuickConnectTypes.QuickConnectConfig CreateQuickConnectConfig()
    {
        var quickConnectConfigResult = new Humidifier.Connect.QuickConnectTypes.QuickConnectConfig();

        return quickConnectConfigResult;
    }
    public override void CreateChildren(Humidifier.Connect.QuickConnectTypes.QuickConnectConfig result)
    {
        base.CreateChildren(result);

        result.QueueConfig ??= QueueConfigFactory?.Build();
        result.PhoneConfig ??= PhoneConfigFactory?.Build();
        result.UserConfig ??= UserConfigFactory?.Build();
    }

} // End Of Class

